import React from 'react';

function RowTable (props){
    
    const Keys = Object.keys(props.dataRow);
    return(
            <tr>
            {
              Keys.map( (keys, index)=>{
                return <td key = {index} >
                            {props.dataRow[keys]}
                        </td>
            }) 
            }
        
        </tr>
    )
}

export default RowTable
